import React from "react";
import TourCard from "../../shared/TourCard";
import tourdata from "../../assets/data/tours"; // Assuming you have imported tourdata from some source
import { Col } from "reactstrap";

export const FeaturedTourList = ({tourda}) => {
  // Filter out only the featured tours
  const featuredTours = tourdata.filter((tour) => tour.featured);

  return (
    <>
      {featuredTours.map((tour) => (
        <Col lg="3" className="mb-4" key={tour.id}>
          <TourCard tour={tour} />
        </Col>
      ))}
    </>
  );
};
